import React from 'react'
import {Box,makeStyles} from '@material-ui/core'

const stylesclass=makeStyles({

    banner_image:{
        background: `url("https://img.rawpixel.com/s3fs-private/rawpixel_images/website_content/rm88-189-fon-0347-a_1.jpg?w=600&amp;dpr=1&amp;fit=default&amp;crop=default&amp;q=65&amp;vib=3&amp;con=3&amp;usm=15&amp;bg=F4F4F3&amp;ixlib=js-2.2.1&amp;s=2dcdb5babfd6aa5be1cf3e3f612e4df5" ") repeat`,
        height:'50vh',
        width:'100vw',
    }

})

function Banner() {
    const styles=stylesclass()
    return (
        <Box  className={styles.banner_image}>
            Hello
        </Box>
    )
}

export default Banner
